  false,\n\t\"url\": null,\n\t\"notes\": \"Environmental Sensitivity Index (ESI) maps
  have been developed for the coastal areas of Central California from Point Conception
  to Point Reyes National Seashore. The ESI maps are a compilation of information
  from three main categories: shoreline types, sensitive biological resources, and
  human-use resources. The individual map pages in this atlas are divided according
  to the U.S. Geological Survey (USGS) 7.5-minute, 1-24,000-scale topographic quadrangle
  index. Black and white scanned images of these maps are used as a backdrop for each
  map page in the atlas. Biological data dates vary from the mid 1990s to 2006, and
  were compiled in 2006. Data include files for use in desktop GIS systems (shape
  files and database), .PDF maps, detailed documentation, user guide, and extensive
  metadata.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
